import React, { useState } from "react";
import "./App.css";

function ShoppingCard() {
  const [products, setProducts] = useState([
    {
      id: 1,
      title: "Apple",
      price: 1000,
      isStock: true,
      image:
        "data:image/jpeg;base64,",
    },
    {
      id: 2,
      title: "Moto",
      price: 15000,
      isStock: true,
      image:
        "data:image/jpeg;base64,",
    },
    {
      id: 3,
      title: "Samsung",
      price: 30000,
      isStock: true,
      image:
        "data:image/jpeg;base64,",
    },
    {
      id: 4,
      title: "Nokia",
      price: 45000,
      isStock: true,
      image:
        "data:image/jpeg;base64,",
    },
    {
      id: 5,
      title: "Redmi",
      price: 55500,
      isStock: true,
      image:
        "data:image/jpeg;base64,",
    },
    {
      id: 6,
      title: "Apple",
      price: 1000,
      isStock: true,
      image:
        "data:image/jpeg;base64,",
    },
    {
      id: 7,
      title: "Moto",
      price: 15000,
      isStock: true,
      image:
        "data:image/jpeg;base64,",
    },
    {
      id: 8,
      title: "Samsung",
      price: 30000,
      isStock: true,
      image:
        "data:image/jpeg;base64,",
    },
    {
      id: 9,
      title: "Nokia",
      price: 45000,
      isStock: true,
      image:
        "data:image/jpeg;base64,",
    },
  ]);
  const [cart, setCart] = useState([]);

  const addToCart = (productId) => {
    const updatedProducts = products.map((product) =>
      product.id === productId ? { ...product, inCart: true } : product
    );
    const selectedProduct = updatedProducts.find(
      (product) => product.id === productId
    );
    setCart([...cart, selectedProduct]);
    setProducts(updatedProducts);
  };

  const removeFromCart = (productId) => {
    const updatedProducts = products.map((product) =>
      product.id === productId ? { ...product, inCart: false } : product
    );
    const updatedCart = cart.filter((product) => product.id !== productId);
    setCart(updatedCart);
    setProducts(updatedProducts);
  };

  return (
    <div>
      <nav className="navbar navbar-expand-lg navbar-light bg-light">
        <div className="container">
          <a className="navbar-brand" href="/">
           <h3>Mobile store</h3> 
          </a>
          <div className="collapse navbar-collapse" id="navbarSupportedContent">
            <ul className="navbar-nav ml-auto">
              <li className="nav-item">
                <a className="nav-link" href="/">
                  Home
                </a>
              </li>
              <li className="nav-item">
                <a className="nav-link" href="/">
                  Products
                </a>
              </li>
              <li className="nav-item">
                <a className="nav-link" href="/">
                  Contact
                </a>
              </li>
            </ul>
            <div className="cart-logo ">
              <img 
                width="50"
                height="50"
                src="https://img.icons8.com/ios-filled/50/shopping-cart.png"
                alt="shopping-cart"
              />
              <div className="cart-badge">{cart.length}</div>
            </div>
          </div>
        </div>
      </nav>
      <div className="container">
        <div class="title"><center><h1 class="titleText" >Mobiles</h1></center></div>
        
        <div className="row">
          {products.map((product) => (
            <div className="col-lg-4 mb-4" key={product.id}>
              <div className="card" style={{ width: "18rem" }}>
                <img 
                  src={product.image}
                  className=" img-class"
                  alt={product.title}
                />
                <div className="card-body">
                  <h5 className="card-title">{product.title}</h5>
                  <p className="card-text">Price: ${product.price}</p>
                  {product.isStock ? (
                    product.inCart ? (
                      <button
                        onClick={() => removeFromCart(product.id)}
                        className="btn btn-danger"
                      >
                        Remove from Cart
                      </button>
                    ) : (
                      <button
                        onClick={() => addToCart(product.id)}
                        className="btn btn-primary"
                      >
                        Add to Cart
                      </button>
                    )
                  ) : (
                    <span className="text-danger">Out of Stock</span>
                  )}
                </div>
              </div>
            </div>
          ))}
        </div>
      </div>
    </div>
  );
}

export default ShoppingCard;
